package com.april.fifth;

public class SwappingOfTwoNo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5;
			int b= 10;
			System.out.println("Before Swap: "+ a + ", "+b);
			int temp =a;
			a=b;
			b=temp;
			System.out.println("After Swap: "+ a + ", "+b);
			
	}

}
